import React from "react";

const TimeSelector = () => {
    return (
        <div>
            <h3>Lad til </h3>
            <select style={{width: "33%"}} name="hour">
                <option value="1">1</option>
            </select>
            <h3 style={{display: "inline-block", marginLeft: "3%", marginRight: "3%"}}>:</h3>
            <select style={{width: "33%"}} name="minute">
                <option value="1">1</option>
            </select>
        </div>
    )
}

export default TimeSelector;
